mapper.select:
select 

from sgjc
where mdbh = #{mdbh,jdbcType=INTEGER}
  and jcrq = #{jcrq,jdbcType=CHAR}
  and khxm = #{khxm,jdbcType=VARCHAR}
  and sjh = #{sjh,jdbcType=VARCHAR}
  and khh = #{khh,jdbcType=VARCHAR}

mapper.delete:
delete from sgjc
where mdbh = #{mdbh,jdbcType=INTEGER}
  and jcrq = #{jcrq,jdbcType=CHAR}
  and khxm = #{khxm,jdbcType=VARCHAR}
  and sjh = #{sjh,jdbcType=VARCHAR}
  and khh = #{khh,jdbcType=VARCHAR}
